/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `name` varchar(20) DEFAULT NULL COMMENT '姓名',
  `number` varchar(9) DEFAULT NULL COMMENT '学号（教工为空）',
  `password` varchar(10) DEFAULT NULL COMMENT '密码（备用）',
  `type` int(11) DEFAULT NULL COMMENT '类型（0是学生，1是老师）',
  `gender` varchar(20) DEFAULT NULL COMMENT '性别（微信提供）',
  `portrait` varchar(200) DEFAULT NULL COMMENT '头像',
  `background` varchar(200) DEFAULT NULL COMMENT '背景',
  `phone_number` varchar(20) DEFAULT NULL COMMENT '手机号',
  `open_id` varchar(200) DEFAULT NULL,
  `wx_union_id` varchar(200) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

